import Product from "./components/Main/Product/Product"
// import Footer from "./components/Main/Footer/Footer"

function App() {
  return (
    <div className="app">
      <div className="section">
        <Navbar/>
        {/* <Header/> */}
        <Blog/>
        <Product/>
        <Footer/>
      </div>

    </div>
  );
}

export default App;
